import React, { useEffect, useState } from "react";

import Header from "./components/Header";

import wallPapper from "./images/wallpapper.jpg";

import "./App.css";

function App() {
  const [projects, setProjects] = useState<string[]>([]);

  const handleAddProject = () => {
    setProjects((projects) => [...projects, `${Date.now()}`]);
  };

  useEffect(() => {
    setProjects(["Desenvolvimento Web", "Desenvolvimento Mobile"]);
  }, []);

  return (
    <div className="App" backGroundImage={wallPapper}>
      <Header title="Projects">
        <ul>
          {projects.map((project) => (
            <li key={project}>{project}</li>
          ))}
        </ul>

        <button onClick={handleAddProject}>New Project</button>
      </Header>
    </div>
  );
}

export default App;
